import { useState } from 'react';
import ProgressBar from 'react-bootstrap/ProgressBar';


const Analysis = ({isSelected, totalWeight, bodyWeight, langauge}) => {
    const [swr, setSwr] = useState(0);
    //setSwr({totalWeight}/{bodyWeight});
    
    function StackedExample(now) { 
        return (
          <ProgressBar>
            <ProgressBar striped variant="secondary" now={((totalWeight/bodyWeight) * 100).toFixed(2)} key={1} label={`${((totalWeight/bodyWeight) * 100).toFixed(2)}%`}/>
            <ProgressBar striped variant="primary" now={(100 - (totalWeight/bodyWeight) * 100).toFixed(2)} key={2} />
          </ProgressBar>
        );
      }
    return ( 
        <div className="container">
            <div className='my-5 text-center'>
         <h3 className='my-2'>You can {isSelected} {((totalWeight/bodyWeight) * 100).toFixed(2)} % of your body weight</h3>
         <h5 className='my-2'>Putting you in the 80th percentile of men</h5>
         {console.log({totalWeight})}
         
         
            <div className="row my-3">
                <div className="col col-md-auto text-left">Untrained</div>   
                <div className='col'>{StackedExample(66)}</div>
                <div className="col col-md-auto text-right">Novice</div>
            </div>

            <h4>Your estimated level of fitness is: Untrained</h4>

        </div>
        </div>
     );
}
 
export default Analysis;
